import React from "react";
import MoneyDisplay from "./moneyDisplay";
import money from "../money.js";


let selectNewAmountAvailable = () => {
    let records = money.length;
    let index = Math.floor(Math.random()*records + 1);
    return index; 
}

function MoneyDisplayBodyWrapper() {
  return (
    <div className="container">
        <div className="row">
        {money[select].moneyimgs.map(moneyimgs =>     
            <MoneyDisplay 
            images={ moneyimgs }
            />
        )}          
        </div>
    </div> 
  );
}

export default MoneyDisplayBodyWrapper;
